trailingComments.value:
*
 * navigation 客户端导航相关桥
 *
 * params(书旗Android):  https://yuque.antfin-inc.com/alwxapp/openapi/navopen
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * libSQ.exec('navigation-app', {
 *   params: {
 *     pageName: 'checkIn',
 *     params: {}
 *   },
 * }).then((info) => {
 *   alert(`[navigation-app][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[navigation-app][error] ${JSON.stringify(err, null, 2)}`);
 * });

